        // à¸§à¸´à¹€à¸„à¸£à¸²à¸°à¸«à¹Œà¸ˆà¸¸à¸”à¸­à¸¢à¹ˆà¸²à¸‡
        const analysis = keypointsService.current.analyzeWeakPoints(trainerPose, traineePose);
