        // à¹€à¸à¹‡à¸šà¹€à¸‰à¸žà¸²à¸° 100 à¸„à¹ˆà¸²à¸¥à¹ˆà¸²à¸ªà¸¸à¸” à¹€à¸žà¸·à¹ˆà¸­à¹„à¸¡à¹ˆà¹ƒà¸«à¹‰ memory leak
        if (accuracyHistoryRef.current.length > 100) {
